
create database robust;

use robust;


DROP TABLE IF EXISTS `admin`;
CREATE TABLE `admin` (
  `username` varchar(50) default NULL,
  `password` varchar(50) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `attackers`;
CREATE TABLE `attackers` (
  `oname` text,
  `cname` text,
  `reason` text,
  `ip` text,
  `an` text,
  `dt` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `attackers1`;
CREATE TABLE `attackers1` (
  `oname` text,
  `cname` text,
  `feedback` text,
  `fid` int(11) default NULL,
  `ip` text,
  `an` text,
  `dt` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `attackers2`;
CREATE TABLE `attackers2` (
  `oname` text,
  `cname` text,
  `ct` text,
  `id` int(11) default NULL,
  `ip` text,
  `an` text,
  `dt` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `backup`;
CREATE TABLE `backup` (
  `id` int(11) NOT NULL auto_increment,
  `oname` text,
  `cname` text,
  `fname` text,
  `mac` text,
  `key1` text,
  `key2` text,
  `pt` text,
  `ct` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `cfiles`;
CREATE TABLE `cfiles` (
  `id` int(11) NOT NULL auto_increment,
  `oname` text,
  `cname` text,
  `fname` text,
  `mac` text,
  `key1` text,
  `key2` text,
  `pt` text,
  `ct` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `cloud`;
CREATE TABLE `cloud` (
  `username` varchar(50) default NULL,
  `password` varchar(50) default NULL,
  `cloud` varchar(50) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `cost`;
CREATE TABLE `cost` (
  `memory` varchar(50) default NULL,
  `cost` varchar(50) default NULL,
  `cloud` varchar(50) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `feedback`;
CREATE TABLE `feedback` (
  `id` int(11) NOT NULL auto_increment,
  `oname` text,
  `cname` text,
  `feedback` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `feedback1`;
CREATE TABLE `feedback1` (
  `id` int(11) NOT NULL auto_increment,
  `oname` text,
  `cname` text,
  `feedback` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `udownloads`;
CREATE TABLE `udownloads` (
  `oname` text,
  `cname` text,
  `fname` text,
  `sk` text,
  `ip` text,
  `an` text,
  `dt` text
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL auto_increment,
  `uname` text,
  `pwd` text,
  `dob` text,
  `email` text,
  `mobile` text,
  `location` text,
  `utype` text,
  `stype` text,
  `cname` text,
  `imagess` longblob,
  `count` int(11) default NULL,
  `sk` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `vm`;
CREATE TABLE `vm` (
  `id` int(11) NOT NULL auto_increment,
  `oname` text,
  `cname` text,
  `memory` text,
  `cost` text,
  `bw` text,
  `dt` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


